import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RoadmapsComponent } from './roadmaps.component';
import { GenericTableModule } from '../../shared/generic-table/generic-table.module';
import { RoadmapService } from 'src/app/core/services/roadmap/roadmap.service';



@NgModule({
  declarations: [RoadmapsComponent],
  imports: [
    CommonModule,
    GenericTableModule,
  ],
  exports:[
    RoadmapsComponent,
    RoadmapService,
  ]
})
export class RoadmapsModule { }
